import React, {Component} from "react"
import "./Section.css"

class Section1 extends Component{

  render(){
  return (

      <nav className="narBar">
        <li> {this.props.Home}</li>
        <li> {this.props.Menu}</li>
        <li> {this.props.Contact}</li>
      </nav>
  )
  }
}
export default Section1;
